import{_ as a,o as e,c as s,Q as n}from"./chunks/framework.1b72a0e7.js";const g=JSON.parse('{"title":"九、Gitkraken 最新版 v9.x 破解教程","description":"","frontmatter":{},"headers":[],"relativePath":"scattered/9-Gitkraken 最新版v9.x破解教程.md","lastUpdated":1699522503000}'),r={name:"scattered/9-Gitkraken 最新版v9.x破解教程.md"},t=n(`<h1 id="九、gitkraken-最新版-v9-x-破解教程" tabindex="-1">九、Gitkraken 最新版 v9.x 破解教程 <a class="header-anchor" href="#九、gitkraken-最新版-v9-x-破解教程" aria-label="Permalink to &quot;九、Gitkraken 最新版 v9.x 破解教程&quot;">​</a></h1><h2 id="gitkraken-最新版-v9-x-全平台破解教程" tabindex="-1">Gitkraken 最新版 v9.x 全平台破解教程 <a class="header-anchor" href="#gitkraken-最新版-v9-x-全平台破解教程" aria-label="Permalink to &quot;Gitkraken 最新版 v9.x 全平台破解教程&quot;">​</a></h2><p>{% link Gitkraken 简体中文, 中文翻译 - github,<a href="https://github.com/Pupper0601/GitKraken-zh" target="_blank" rel="noreferrer">https://github.com/Pupper0601/GitKraken-zh</a> %} {% link Gitkraken 简体中文, 中文翻译 - 本站,<a href="https://pupper.cn/posts/26ce11d3.html" target="_blank" rel="noreferrer">https://pupper.cn/posts/26ce11d3.html</a> %}</p><h2 id="一、-免责声明" tabindex="-1">一、 免责声明 <a class="header-anchor" href="#一、-免责声明" aria-label="Permalink to &quot;一、 免责声明&quot;">​</a></h2><p>所有内容资源均来源于网络，仅供交流学习与研究使用，版权归属原版权方所有，版权争议与本人无关，用户本人下载后不能用作商业或非法用途，否则后果均由用户承担责任; 如果您访问和下载此文件，表示您同意只将此软件用于参考、学习而非其他用途，否则一切后果请您自行承担，请于下载后 24 小时内删除，不允许用于商业用途，否则法律问题自行承担。 如果您喜欢该软件，请支持正版软件，购买注册，得到更好的正版服务。</p><h2 id="二、软件安装" tabindex="-1">二、软件安装 <a class="header-anchor" href="#二、软件安装" aria-label="Permalink to &quot;二、软件安装&quot;">​</a></h2><p>此工具支持破解 Gitkraken V7.7.0 ~ V9.x(最新版)，直接从官网下载最新的安装包即可，如后续破解工具失效，可回退到旧版进行激活</p><p>(亲测 9.6.0 可用)</p><p>官网下载地址：<a href="https://www.gitkraken.com/download" target="_blank" rel="noreferrer">Gitkraken</a></p><h3 id="macos-用户" tabindex="-1">MacOS 用户 <a class="header-anchor" href="#macos-用户" aria-label="Permalink to &quot;MacOS 用户&quot;">​</a></h3><ol><li><p>如果你之前安装过该软件，请先卸载，并清理用户缓存（<code>rm -r ~/.gitkraken</code>)</p></li><li><p>下载安装包</p></li></ol><p>​ 如果是从官网下载的最新安装包，后缀为 <code>.dmg</code>，下载完直接双击运行，会提示拖动到 <strong>Applications</strong> 中，然后就会在启动台（开始菜单）看到图标。</p><p>​ 如果你下载的稍旧点的版本（后缀为 <code>.zip</code>），在&quot;<strong>访达</strong>&quot;页面解压完后双击运行，如果是进入了软件主界面而不是（如下图）提示拖动到 <strong>Applications</strong> 中，那么你需要关闭软件，手动将安装包拖动到访达左侧的 <strong>Applications</strong>(应用程序)中</p><img src="https://img.pupper.cn/img/gitkraken-step1.jpg" alt="Snipaste_2023-07-14_09-32-17" style="zoom:67%;"><ol><li><p>安装完成后，在<strong>启动台</strong>（开始菜单）中找到 Gitkraken 图标，并点击运行。</p></li><li><p>进入引导页面</p><p>这里以 9.6.0 版本为例，用户界面如下所示，点击绿色按钮开始使用，不用点击下方的登录。</p><img src="https://img.pupper.cn/img/gitkraken-step2.jpg" alt="Snipaste_2023-07-14_09-36-12" style="zoom:67%;"></li><li><p>输入你的用户名、邮箱后，点击绿色按钮</p><p>（注：这里的用户名、邮箱就是你以后 git push 后显示的个人信息）</p><img src="https://img.pupper.cn/img/gitkraken-step3.jpg" alt="Snipaste_2023-07-14_09-36-54" style="zoom:67%;"></li><li><p>按提示打开一个 git 仓库，可以是本地的，或者 clone 远程的</p></li><li><p>关闭 Gitkran，并确保在底部 Dock 栏也<strong>完全退出</strong></p></li></ol><blockquote><p>MacOS 上如果遇到软件<strong>已损坏</strong>的问题，请参考：<a href="https://zhuanlan.zhihu.com/p/114919138" target="_blank" rel="noreferrer">解决方法</a></p></blockquote><h3 id="windows-用户" tabindex="-1">Windows 用户 <a class="header-anchor" href="#windows-用户" aria-label="Permalink to &quot;Windows 用户&quot;">​</a></h3><p>下载 v9.x 安装包，双击运行，会自动安装到 C 盘并进入主页面，操作步骤同前面 Mac 一样，按绿色按钮，输入用户名、邮箱后再点击绿色按钮，随便打开一个 git 仓库，然后关闭软件。</p><p>关闭 Girkraken 后若发现其未自动创建桌面快捷方式，可到 <code>C:\\Users\\{用户名}\\AppData\\Local\\gitkraken</code> 目录，找到 gitkraken.exe 为其创建快捷方式.</p><h2 id="三、破解步骤" tabindex="-1">三、破解步骤 <a class="header-anchor" href="#三、破解步骤" aria-label="Permalink to &quot;三、破解步骤&quot;">​</a></h2><p>此工具 <code>GNU/Linux</code> (without <code>snap</code>), <code>Windows</code>和<code>macOS</code> 全平台可用</p><h3 id="_1-下载破解工具" tabindex="-1">1. 下载破解工具 <a class="header-anchor" href="#_1-下载破解工具" aria-label="Permalink to &quot;1. 下载破解工具&quot;">​</a></h3><p>下载链接: <a href="https://pan.baidu.com/s/1P4j6p7pzecyx63gr5iS_BQ?pwd=91fu" target="_blank" rel="noreferrer">百度网盘</a></p><p>此破解工具之前发布于 github 上的源码已被和谐，此次用到的破解工具来源于同一作者，程序开源，<strong>切勿用于商业用途</strong>。</p><h3 id="_2-环境准备" tabindex="-1">2. 环境准备 <a class="header-anchor" href="#_2-环境准备" aria-label="Permalink to &quot;2. 环境准备&quot;">​</a></h3><ul><li><p>安装 Node.js &gt;=12</p></li><li><p>安装 yarn 包管理工具</p><div class="language-sh line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">npm</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">install</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--global</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">yarn</span></span>
<span class="line"></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div></li></ul><h3 id="_3-开始破解" tabindex="-1">3. 开始破解 <a class="header-anchor" href="#_3-开始破解" aria-label="Permalink to &quot;3. 开始破解&quot;">​</a></h3><p><strong>⚠️ 警告：破解之前先关闭 Gitkraken 软件</strong></p><p>解压破解工具，进入工具中的 GitCracken 目录，然后在此目录打开命令行，依次执行以下 3 条命令：</p><div class="language-bash line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">yarn</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">install</span></span>
<span class="line"><span style="color:#FFCB6B;">yarn</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">build</span></span>
<span class="line"><span style="color:#FFCB6B;">yarn</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">gitcracken</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">patcher</span><span style="color:#A6ACCD;">     </span><span style="color:#676E95;font-style:italic;"># Mac\\Linux 用户可能需要root权限，需在前面加上 sudo</span></span>
<span class="line"></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><p>如图所示：</p><p><img src="https://img.pupper.cn/img/gitkraken9.png" alt="image-20230307235617800"></p><p>mac 或 linux 可能会报错，不用理会，继续执行下面的代码即可</p><h3 id="_4-验证是否成功" tabindex="-1">4. 验证是否成功 <a class="header-anchor" href="#_4-验证是否成功" aria-label="Permalink to &quot;4. 验证是否成功&quot;">​</a></h3><p>v9.x 版本：重新打开 Gitkraken，破解成功会在右下角看到 Pro 标志，如果破解失败就依然是 Free 标志。</p><p>稍旧点的 v7、v8 版本：Gitkraken 初次使用会让你先登录账号，建议用 github 账号授权登录（记得用梯子）</p><ul><li>若点击用 Github 授权登录没反应，检查 hosts 文件是不是把 gitkraken 网址屏蔽了</li><li>若在浏览器中显示授权失败，xxx error 之类的，多尝试登录几次即可</li></ul><p>登录账号后你会看到右下角显示 <strong>Pro</strong>，如果显示 free 可能是你之前的账号信息未清理干净，请尝试删除目录： <code>C:\\Users\\{用户名}\\AppData\\Roaming\\\\.gitkraken</code> （Windows 用户）或 <code>~/.gitkraken</code> （Mac、Linux 用户）</p><p><img src="https://img.pupper.cn/img/202307042234098.png" alt="image-20230704223447045"></p><h3 id="_5-禁用更新-可选" tabindex="-1">5. 禁用更新（可选） <a class="header-anchor" href="#_5-禁用更新-可选" aria-label="Permalink to &quot;5. 禁用更新（可选）&quot;">​</a></h3><blockquote><p>到目前最新版的 v9.x 都可破解使用，所以你 duck 不必禁用更新，继续白嫖最新功能 😂。</p><p>如果自动更新了，再次运行破解命令就行，不用删除<code>.gitkraken</code> 文件夹，你也不想你的项目和账号信息都清空吧</p></blockquote><p>Window 平台直接删除： <code>C:\\Users\\{用户名}\\AppData\\Local\\gitkraken\\Update.exe</code> 即可。</p><p>其他平台：</p><p>将以下内容添加到你的 <code>hosts</code> 文件中</p><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">0.0.0.0 release.gitkraken.com</span></span>
<span class="line"><span style="color:#A6ACCD;">0.0.0.0 api.gitkraken.com</span></span>
<span class="line"><span style="color:#A6ACCD;">0.0.0.0 gloapi.gitkraken.com</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><p>hosts 文件路径：</p><ul><li>C:\\Windows\\System32\\drivers\\etc</li></ul><p>或者</p><ul><li>/etc/hosts</li></ul><h2 id="其他" tabindex="-1">其他 <a class="header-anchor" href="#其他" aria-label="Permalink to &quot;其他&quot;">​</a></h2><h3 id="windows-卸载残留" tabindex="-1">Windows 卸载残留 <a class="header-anchor" href="#windows-卸载残留" aria-label="Permalink to &quot;Windows 卸载残留&quot;">​</a></h3><ul><li><code>C:\\Users\\{用户名}\\AppData\\Roaming\\\\.gitkraken</code> （<strong>注</strong>：这里存放账号信息、打开过的项目、用户设置等，如果你只是升级版本，可以不用删除）</li><li><code>C:\\Users\\{用户名}\\AppData\\Roaming\\GitKraken</code></li><li><code>C:\\Users\\{用户名}\\AppData\\Local\\gitkraken</code> （<strong>注</strong>：这是默认安装位置，如果安装完成后桌面没有快捷方式，可从这里启动）</li></ul><h3 id="mac-卸载残留" tabindex="-1">Mac 卸载残留 <a class="header-anchor" href="#mac-卸载残留" aria-label="Permalink to &quot;Mac 卸载残留&quot;">​</a></h3><div class="language-sh line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">rm</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-r</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">~/.gitkraken</span></span>
<span class="line"></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="历史版本下载" tabindex="-1">历史版本下载 <a class="header-anchor" href="#历史版本下载" aria-label="Permalink to &quot;历史版本下载&quot;">​</a></h3><p>改改版本号就行</p><ul><li>Linux-deb : <a href="https://release.axocdn.com/linux/GitKraken-v7.7.0.deb" target="_blank" rel="noreferrer">https://release.axocdn.com/linux/GitKraken-v7.7.0.deb</a></li><li>Linux-rpm : <a href="https://release.axocdn.com/linux/GitKraken-v7.7.0.rpm" target="_blank" rel="noreferrer">https://release.axocdn.com/linux/GitKraken-v7.7.0.rpm</a></li><li>Linux-tar.gz : <a href="https://release.axocdn.com/linux/GitKraken-v7.7.0.tar.gz" target="_blank" rel="noreferrer">https://release.axocdn.com/linux/GitKraken-v7.7.0.tar.gz</a></li><li>Win64： <a href="https://release.axocdn.com/win64/GitKrakenSetup-7.7.0.exe" target="_blank" rel="noreferrer">https://release.axocdn.com/win64/GitKrakenSetup-7.7.0.exe</a></li><li>Mac (Intel) : <a href="https://release.axocdn.com/darwin/GitKraken-v7.7.0.zip" target="_blank" rel="noreferrer">https://release.axocdn.com/darwin/GitKraken-v7.7.0.zip</a></li><li>Mac (Apple Silicon) 从 v9.0.0 开始支持：(<a href="https://release.axocdn.com/darwin-arm64/GitKraken-v9.0.0.zip" target="_blank" rel="noreferrer">https://release.axocdn.com/darwin-arm64/GitKraken-v9.0.0.zip</a>)</li></ul><h3 id="百度云地址" tabindex="-1">百度云地址 <a class="header-anchor" href="#百度云地址" aria-label="Permalink to &quot;百度云地址&quot;">​</a></h3><p>部分老版本：<a href="https://pan.baidu.com/s/1z-Ij_piWLAXq8qpG5_5DTg?pwd=u17p" target="_blank" rel="noreferrer">百度网盘</a></p><hr><h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2><h3 id="_1-不开代理软件无法拉取代码" tabindex="-1">1. 不开代理软件无法拉取代码 <a class="header-anchor" href="#_1-不开代理软件无法拉取代码" aria-label="Permalink to &quot;1. 不开代理软件无法拉取代码&quot;">​</a></h3><p>可能是在安装 Gitkraken 时，你有正在使用的代理软件，Gitkraken 自动将其设置成了 git 代理，可通过以下命令查看</p><div class="language-sh line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">config</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--global</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">http.proxy</span></span>
<span class="line"></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>如果显示了你代理软件的地址，请将其移除：</p><div class="language-sh line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">config</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--global</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--unset</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">http.proxy</span></span>
<span class="line"></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="_2-mac-上加了-sudo-仍然提示权限不足" tabindex="-1">2. Mac 上加了 sudo 仍然提示权限不足 <a class="header-anchor" href="#_2-mac-上加了-sudo-仍然提示权限不足" aria-label="Permalink to &quot;2. Mac 上加了 sudo 仍然提示权限不足&quot;">​</a></h3><p>当你使用第三方终端软件时（如 iTerm、Warp 等），系统为了保证用户数据安全，默认不允许这些软件用命令更新或者删除其他应用，可在设置-&gt;隐私与安全性中找到相关设置，当然最简单的解决方法是用系统默认的 Terminal 终端软件。</p>`,68),l=[t];function o(p,i,c,d,h,u){return e(),s("div",null,l)}const m=a(r,[["render",o]]);export{g as __pageData,m as default};
